import React from "react";
import ReactDOM from "react-dom";

function Cards() {
  return (
    <div className="cards">
      <div className="card">
        <img
          src="https://w0.peakpx.com/wallpaper/592/913/HD-wallpaper-jonas-dark-dark-netflix-dark-series-everything-is-connected-netflix-triquetra.jpg"
          alt="pic"
          className="card_img"
        />
        <div className="card_info">
          <span className="card_category">A Netflix Original Series</span>
          <h3 className="card_title">DARK</h3>
          <a href="https://www.netflix.com/in/title/80100172" target="_blank">
            <button>Watch Now</button>
          </a>
        </div>
      </div>
    </div>
  );
}

export default Cards;
